                        </li>
                        <li>
                          <a class="dropdown-item" href="#">
                            2030
                          </a>
                        </li>
                      </ul>
                    </div>
                    </div>
                  </td>
                </tr>
              </tbody>
            </table>

            <div className="mb-3">
              <div className="mb-3">
                {/* <Link to="/"><h6>Add Bank Details</h6></Link> */}
              </div>
              <button onClick={wrapper} className="btn btn-primary">Pay Now</button>
            </div>
          </div>
        </div>
        <div className="col"></div>
      </div>
    </div>
    </div>
  );
}

export default Paymentpage;
